def lilypond_rule8(colorer, s, i):
    return colorer.match_mark_previous(s, i, kind="function", pattern="=",
          at_whitespace_end=True)

def lilypond_rule9(colorer, s, i):
    return colorer.match_mark_previous(s, i, kind="function", pattern="=",
          at_whitespace_end=True)

